,'field_63bc7bffe9d35'),(416,2,'builder_8_image_content_class',''),(417,2,'_builder_8_image_content_class','field_63bc7c0ae9d36'),(418,2,'builder_8_image_content_background_image','133'),(419,2,'_builder_8_image_content_background_image','field_63bc7c48e9d37'),(420,2,'builder_8_image_content_pretitle','Specialty Services'),(421,2,'_builder_8_image_content_pretitle','field_63bc82b6c0146'),(422,2,'builder_8_image_content_content','<h2>GREASE TRAPS</h2>\r\n<span style=\"font-weight: 400;\">Cleaning grease traps is an essential task for maintaining the proper functioning of your kitchen\'s plumbing system. Grease traps are designed to capture grease, oil, and other fats that can clog pipes and lead to costly damage. It is important to regularly clean the grease trap to prevent unpleasant odors and to ensure the safe disposal of waste. Our professional cleaning service can help keep your grease trap functioning properly and extend its lifespan. We use specialized equipment to remove the built-up grease and dispose of it properly, ensuring that your kitchen remains hygienic and free of unpleasant odors. Contact us today to have your grease trap cleaned!</span>'),(423,2,'_builder_8_image_content_content','field_63bc7c53e9d38'),(424,2,'builder_8_image_content_main_image','115'),(425,2,'_builder_8_image_content_main_image','field_63bc7c5fe9d39'),(426,2,'builder_8_image_content_link','a:3:{s:5:\"title\";s:10:\"Contact Us\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(427,2,'_builder_8_image_content_link','field_63bc7c6ce9d3a'),(428,2,'builder_8_image_content',''),(429,2,'_builder_8_image_content','field_63bc7beee9d34'),(430,2,'builder_9_layout','Image + Content'),(431,2,'_builder_9_layout','field_63bc7ad1e9d28'),(432,2,'builder_9_image_content_content_side','Left'),(433,2,'_builder_9_image_content_content_side','field_63bc7e06e9d45'),(434,2,'builder_9_image_content_style',''),(435,2,'_builder_9_image_content_style','field_63bc7bffe9d35'),(436,2,'builder_9_image_content_class',''),(437,2,'_builder_9_image_content_class','field_63bc7c0ae9d36'),(438,2,'builder_9_image_content_background_image','135'),(439,2,'_builder_9_image_content_background_image','field_63bc7c48e9d37'),(440,2,'builder_9_image_content_pretitle','Specialty Services'),(441,2,'_builder_9_image_content_pretitle','field_63bc82b6c0146'),(442,2,'builder_9_image_content_content','<h2>LIFT STATIONS</h2>\r\n<span style=\"font-weight: 400;\">Having a clean lift station is an important task in maintaining the proper functioning of your sewage or wastewater system. Lift stations are used to pump waste water or sewage from low-lying areas to a higher elevation, where it can be transported to a treatment facility. Over time, these stations can become clogged with debris, solids, and grease, leading to malfunctions and backups. Regular cleaning of lift stations is crucial to prevent blockages, and to ensure the efficient and safe transport of waste water. Keeping your lift station clean and properly maintained will reduce the risk of costly repairs and unplanned downtime, and ensure that your waste water system runs smoothly. Contact us today for your next lift cleaning appointment.</span>'),(443,2,'_builder_9_image_content_content','field_63bc7c53e9d38'),(444,2,'builder_9_image_content_main_image','117'),(445,2,'_builder_9_image_content_main_image','field_63bc7c5fe9d39'),(446,2,'builder_9_image_content_link','a:3:{s:5:\"title\";s:10:\"Contact Us\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(447,2,'_builder_9_image_content_link','field_63bc7c6ce9d3a'),(448,2,'builder_9_image_content',''),(449,2,'_builder_9_image_content','field_63bc7beee9d34'),(450,2,'builder_10_layout','Testimonials'),(451,2,'_builder_10_layout','field_63bc7ad1e9d28'),(452,2,'builder_10_testimonials_group_style',''),(453,2,'_builder_10_testimonials_group_style','field_63bc7f83e9d4e'),(454,2,'builder_10_testimonials_group_class',''),(455,2,'_builder_10_testimonials_group_class','field_63bc7f8de9d4f'),(456,2,'builder_10_testimonials_group_testimonials_0_content','Suc N Up is amazing and I would recommend them to everyone I know. They went above and beyond what a company should for us. We Called Suc N Up and they came right out to pump and certify our septic tank. They treated us like family, coming out 40+ miles multiple times to handle the obstacles we had in our yard. I was again very impressed when they showed up a few days later at 7pm, in the cold and dark to put risers, lids and fill our 4 foot hole to get it done. Great Job! Thank you.'),(457,2,'_builder_10_testimonials_group_testimonials_0_content','field_63bc7fc7e9d51'),(458,2,'builder_10_testimonials_group_testimonials_0_name','Cheryl Braun'),(459,2,'_builder_10_testimonials_group_testimonials_0_name','field_63bc7fcfe9d52'),(460,2,'builder_10_testimonials_group_testimonials_0_job_title','Client'),(461,2,'_builder_10_testimonials_group_testimonials_0_job_title','field_63bc7fdae9d53'),(462,2,'builder_10_testimonials_group_testimonials_1_content','I was awoken to the septic system backing up into the house...good times. I called Suc N Up sanitation and by the afternoon my septic tank had been pumped clean and repaired. Such a great company! Outstanding customer service. Friendly and knowledgable folks. They took an awful situation and fixed it. Great price too! I am certainly pleased! Thank you!'),(463,2,'_builder_10_testimonials_group_testimonials_1_content','field_63bc7fc7e9d51'),(464,2,'builder_10_testimonials_group_testimonials_1_name','Megan Rose'),(465,2,'_builder_10_testimonials_group_testimonials_1_name','field_63bc7fcfe9d52'),(466,2,'builder_10_testimonials_group_testimonials_1_job_title','Client'),(467,2,'_builder_10_testimonials_group_testimonials_1_job_title','field_63bc7fdae9d53'),(468,2,'builder_10_testimonials_group_testimonials_2_content','I have to admit, I\'m a repeat customer! Gene was so awesome when I was trying to sell my previous home, I had them service my new home. Came time to have it done again and they were the first company I thought of. Colin and Gene came out on time and were very professional and helpful. Have to give Pam in the office kudos as well. She was very helpful getting everything scheduled. All around good company to use!'),(469,2,'_builder_10_testimonials_group_testimonials_2_content','field_63bc7fc7e9d51'),(470,2,'builder_10_testimonials_group_testimonials_2_name','Ali Calder'),(471,2,'_builder_10_testimonials_group_testimonials_2_name','field_63bc7fcfe9d52'),(472,2,'builder_10_testimonials_group_testimonials_2_job_title','Client'),(473,2,'_builder_10_testimonials_group_testimonials_2_job_title','field_63bc7fdae9d53'),(474,2,'builder_10_testimonials_group_testimonials_3_content','Outstanding service! I would highly recommend Suc N Up to anyone that is needing septic cleaning/pumping. Craig is honest and friendly along with his coworker, I did not catch his name. I called this morning and they arrived just a few hours later. Very reasonably priced, just an overall great experience.'),(475,2,'_builder_10_testimonials_group_testimonials_3_content','field_63bc7fc7e9d51'),(476,2,'builder_10_testimonials_group_testimonials_3_name','Sarah J.C'),(477,2,'_builder_10_testimonials_group_testimonials_3_name','field_63bc7fcfe9d52'),(478,2,'builder_10_testimonials_group_testimonials_3_job_title','Client'),(479,2,'_builder_10_testimonials_group_testimonials_3_job_title','field_63bc7fdae9d53'),(480,2,'builder_10_testimonials_group_testimonials_4_content','This company is by far the best in the area. They do an amazing job. I will recommend for all of my friends and family. Reasonable in price and does everything the RIGHT WAY, not the quick solution way. Thank you so much for getting us back up and running! I\'ll also add they are professional, kind, and quick. You\'ll be our go-to from now on. I can\'t recommend you enough!'),(481,2,'_builder_10_testimonials_group_testimonials_4_content','field_63bc7fc7e9d51'),(482,2,'builder_10_testimonials_g