 grease trap cleaned!</span>'),(3334,145,'_builder_8_image_content_content','field_63bc7c53e9d38'),(3335,145,'builder_8_image_content_main_image','115'),(3336,145,'_builder_8_image_content_main_image','field_63bc7c5fe9d39'),(3337,145,'builder_8_image_content_link','a:3:{s:5:\"title\";s:10:\"Contact Us\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(3338,145,'_builder_8_image_content_link','field_63bc7c6ce9d3a'),(3339,145,'builder_8_image_content',''),(3340,145,'_builder_8_image_content','field_63bc7beee9d34'),(3341,145,'builder_9_layout','Image + Content'),(3342,145,'_builder_9_layout','field_63bc7ad1e9d28'),(3343,145,'builder_9_image_content_content_side','Left'),(3344,145,'_builder_9_image_content_content_side','field_63bc7e06e9d45'),(3345,145,'builder_9_image_content_style',''),(3346,145,'_builder_9_image_content_style','field_63bc7bffe9d35'),(3347,145,'builder_9_image_content_class',''),(3348,145,'_builder_9_image_content_class','field_63bc7c0ae9d36'),(3349,145,'builder_9_image_content_background_image','135'),(3350,145,'_builder_9_image_content_background_image','field_63bc7c48e9d37'),(3351,145,'builder_9_image_content_pretitle','Specialty Services'),(3352,145,'_builder_9_image_content_pretitle','field_63bc82b6c0146'),(3353,145,'builder_9_image_content_content','<h2>LIFT STATIONS</h2>\r\n<span style=\"font-weight: 400;\">Having a clean lift station is an important task in maintaining the proper functioning of your sewage or wastewater system. Lift stations are used to pump waste water or sewage from low-lying areas to a higher elevation, where it can be transported to a treatment facility. Over time, these stations can become clogged with debris, solids, and grease, leading to malfunctions and backups. Regular cleaning of lift stations is crucial to prevent blockages, and to ensure the efficient and safe transport of waste water. Keeping your lift station clean and properly maintained will reduce the risk of costly repairs and unplanned downtime, and ensure that your waste water system runs smoothly. Contact us today for your next lift cleaning appointment.</span>'),(3354,145,'_builder_9_image_content_content','field_63bc7c53e9d38'),(3355,145,'builder_9_image_content_main_image','117'),(3356,145,'_builder_9_image_content_main_image','field_63bc7c5fe9d39'),(3357,145,'builder_9_image_content_link','a:3:{s:5:\"title\";s:10:\"Contact Us\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(3358,145,'_builder_9_image_content_link','field_63bc7c6ce9d3a'),(3359,145,'builder_9_image_content',''),(3360,145,'_builder_9_image_content','field_63bc7beee9d34'),(3361,145,'builder_10_layout','Testimonials'),(3362,145,'_builder_10_layout','field_63bc7ad1e9d28'),(3363,145,'builder_10_testimonials_group_style',''),(3364,145,'_builder_10_testimonials_group_style','field_63bc7f83e9d4e'),(3365,145,'builder_10_testimonials_group_class',''),(3366,145,'_builder_10_testimonials_group_class','field_63bc7f8de9d4f'),(3367,145,'builder_10_testimonials_group_testimonials_0_content','Suc N Up is amazing and I would recommend them to everyone I know. They went above and beyond what a company should for us. We Called Suc N Up and they came right out to pump and certify our septic tank. They treated us like family, coming out 40+ miles multiple times to handle the obstacles we had in our yard. I was again very impressed when they showed up a few days later at 7pm, in the cold and dark to put risers, lids and fill our 4 foot hole to get it done. Great Job! Thank you.'),(3368,145,'_builder_10_testimonials_group_testimonials_0_content','field_63bc7fc7e9d51'),(3369,145,'builder_10_testimonials_group_testimonials_0_name','Cheryl Braun'),(3370,145,'_builder_10_testimonials_group_testimonials_0_name','field_63bc7fcfe9d52'),(3371,145,'builder_10_testimonials_group_testimonials_0_job_title','Client'),(3372,145,'_builder_10_testimonials_group_testimonials_0_job_title','field_63bc7fdae9d53'),(3373,145,'builder_10_testimonials_group_testimonials_1_content','I was awoken to the septic system backing up into the house...good times. I called Suc N Up sanitation and by the afternoon my septic tank had been pumped clean and repaired. Such a great company! Outstanding customer service. Friendly and knowledgable folks. They took an awful situation and fixed it. Great price too! I am certainly pleased! Thank you!'),(3374,145,'_builder_10_testimonials_group_testimonials_1_content','field_63bc7fc7e9d51'),(3375,145,'builder_10_testimonials_group_testimonials_1_name','Megan Rose'),(3376,145,'_builder_10_testimonials_group_testimonials_1_name','field_63bc7fcfe9d52'),(3377,145,'builder_10_testimonials_group_testimonials_1_job_title','Client'),(3378,145,'_builder_10_testimonials_group_testimonials_1_job_title','field_63bc7fdae9d53'),(3379,145,'builder_10_testimonials_group_testimonials_2_content','I have to admit, I\'m a repeat customer! Gene was so awesome when I was trying to sell my previous home, I had them service my new home. Came time to have it done again and they were the first company I thought of. Colin and Gene came out on time and were very professional and helpful. Have to give Pam in the office kudos as well. She was very helpful getting everything scheduled. All around good company to use!'),(3380,145,'_builder_10_testimonials_group_testimonials_2_content','field_63bc7fc7e9d51'),(3381,145,'builder_10_testimonials_group_testimonials_2_name','Ali Calder'),(3382,145,'_builder_10_testimonials_group_testimonials_2_name','field_63bc7fcfe9d52'),(3383,145,'builder_10_testimonials_group_testimonials_2_job_title','Client'),(3384,145,'_builder_10_testimonials_group_testimonials_2_job_title','field_63bc7fdae9d53'),(3385,145,'builder_10_testimonials_group_testimonials_3_content','Outstanding service! I would highly recommend Suc N Up to anyone that is needing septic cleaning/pumping. Craig is honest and friendly along with his coworker, I did not catch his name. I called this morning and they arrived just a few hours later. Very reasona